import React from 'react';
import Header from './Header';
import Footer from './Footer';
import Bg from './images/Bg.jpg';

function Homepage() {
  return (
    <div className="text-white block font-serif font-extrabold bg-cover min-h-screen" style={{ backgroundImage: `url(${Bg})` }}>
      <div className="pt-4  ">
        <Header />
      </div>
      <div className="pl-7 pt-10">
        <p className="text-6xl w-5 text-end gap-6">Welcome to my Blog Post Web</p>
        <div className="pt-6">
        <h1 className=" text-3xl">Chhon</h1>
        <h1 className=" text-4xl">KimEang</h1>
        <p className="text-2xl">OW Student</p>
        </div>
      </div>
      <div className=" pl-3 absolute bottom-5">
        <Footer />
      </div>
    </div>
  );
}

export default Homepage;
